import React, { useState, useEffect, ChangeEvent } from 'react';
import { getArray, postArray } from '../../api/api';

import FormControl from '@material-ui/core/FormControl';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';

const Chiropractors = () => {

    interface IChiropractors {
        chiropractorId: number;
        firstName: string;
        lastname: string;
        emailAddress: string;
        phoneNumber: number;
        timeCreated: Date;

        postData: string;
        data: any;
    }

    const [chiropractorDetails, setchiropractorDetails] = useState<any[]>([]);

    

    useEffect(() => {
        const makeArrayRequest = async () => {
            setchiropractorDetails(await getArray());
        }
        makeArrayRequest();
    }, [])

    const [PostDetails, setPostDetails] = useState('');
    const handlePostDetailsChange = (x: any | null) => {
        setPostDetails(x);
    }
    const [HasFocus, setHasFocus] = useState<boolean>(false);

    const handleSubmit = () => {
        console.log(PostDetails);
    }
    

    
    return (
        <>
            {chiropractorDetails.map(x => <li key={x.chiropractorId}> {x.firstName} {x.firstName} {x.emailAddress} {x.phoneNumber} {x.timeCreated}</li>)}

            <TextField
                label="first name"
                value={PostDetails}
                onChange={e => handlePostDetailsChange(e.target.value)}
                onClick={() => setHasFocus(true)}
            />
            <Button variant="contained" color="primary" onClick={handleSubmit}>Submit</Button>
        </>
    )
}

export default Chiropractors;
